import React from "react";
import ReactStars from "react-rating-stars-component";
import "./SkillCard.css";

function SkillCard({ skillName, rating }) {
  return (
    <div className="skill-card">
        <h6>{skillName}</h6>
      <ReactStars
        count={5}
        onChange={() => {}}
        value={rating}
        size={36}
        edit={false}
        em
        activeColor="#D83A52"
      />
    </div>
  );
}

export default SkillCard;
